import React from "react";

export default function Checking() {
  let details = [
    {
      name: "Pankaj Singh",
    },
    {
      name: "Yashi Gupta",
    },
    {
      name: "preet sharma",
    },
  ];

  return (
    <div>
      <a href="">
        {details.map((x, i) => {
          return <li key={i}>{x.name}</li>;
        })}
      </a>
    </div>
  );
}
